import React from 'react'



class Footer extends React.Component {
    render() {
        return(
            <div>

<footer>

<p>Kleco Clothing Worldwide&copy; 2020</p>


    <ul class="social-logos">
        <li><a target="_blank" rel="noopener no referrer" href="http://www.facebook.com"><img src="https://i1.wp.com/hipstory.org/wp-content/uploads/2016/01/transparent-facebook-logo-icon1-1024x1024.png?fit=1024%2C1024" alt="facebook icon"/></a></li>
        <li><a target="_blank" rel="noopener no referrer"  href="https://www.instagram.com/"><img src="https://i.pinimg.com/originals/69/68/69/69686902815d4ca58040d21bff5f1b67.png" alt="instagram icon"/></a></li>
      </ul>



</footer>

            </div>
        )
    }
}

export default Footer;
